import React from "react";
import "./filter.css";

const Filter = props => {
  const { skills } = props;
  return (
    <div id="filter-container">
      <div className="row">
        <div className="col-sm-12 skills-container">
          <h4>Skills</h4>
          {skills.map(s => (
            <div>{s.name}</div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Filter;
